d1f\"},\"disableImageZooming\":true},\"taskDescription\":\"<h2><strong>Estimados estudiantes:</strong></h2>\\n\\n<p>La siguiente actividad tiene como propósito reforzar su comprensión sobre <strong>los efectos que los recursos retóricos generan en la audiencia</strong> y <strong>las razones por las que los oradores los utilizan en sus discursos</strong>. Lean cuidadosamente cada oración y arrastren las palabras correctas al espacio en blanco según corresponda.</p>\\n\\n<p> </p>\\n\",\"overallFeedback\":[{\"from\":0,\"to\":40,\"feedback\":\"Necesitas reforzar tu comprensión. Estudia los efectos y propósitos de los recursos retóricos y vuelve a intentarlo.\"},{\"from\":41,\"to\":80,\"feedback\":\"Aún puedes mejorar. Revisa la presentación interactiva antes de volver a intentarlo.\"},{\"from\":81,\"to\":100,\"feedback\":\"¡Excelente! Has identificado correctamente los efectos y motivos del uso de recursos retóricos.\"}],\"checkAnswer\":\"Comprobar\",\"submitAnswer\":\"Enviar\",\"tryAgain\":\"Reintentar\",\"showSolution\":\"Mostrar solución\",\"dropZoneIndex\":\"Zona de colocación @index.\",\"empty\":\"La zona de Colocación @index está vacía.\",\"contains\":\"la zona de Colocación @index contiene elemento @draggable.\",\"ariaDraggableIndex\":\"@index de @count elementos que se pueden colocar.\",\"tipLabel\":\"Mostrar pista\",\"correctText\":\"¡Correcto!\",\"incorrectText\":\"¡Incorrecto!\",\"resetDropTitle\":\"Restablecer colocación\",\"resetDropDescription\":\"¿Seguro que quieres restablecer esta zona de colocación?\",\"grabbed\":\"Has cogido el elemento a arrastrar.\",\"cancelledDragging\":\"Arrastre cancelado.\",\"correctAnswer\":\"Respuesta correcta:\",\"feedbackHeader\":\"Retroalimentación\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":false,\"enableCheckButton\":true,\"instantFeedback\":false},\"scoreBarLabel\":\"Has obtenido :num de un total de :total puntos\",\"a11yCheck\":\"Comprueba las respuestas. Las respuestas se marcarán como correctas, incorrectas o sin respuesta.\",\"a11yShowSolution\":\"Mostrar la solución. El trabajo será calificado con su solución correcta.\",\"a11yRetry\":\"Vuelve a intentar la tarea. Borra todas tus respuestas y empieza de nuevo.\",\"textField\":\"Los recursos retóricos como la *metáfora* o la pregunta retórica ayudan a captar la atención del oyente.\\n\\nEl orador utiliza figuras retóricas para expresar mejor sus *emociones* y conectar emocionalmente con la audiencia.\\n\\nLa *memorización* permite que el mensaje sea más fácil de recordar gracias a elementos como la repetición o el ritmo.\\n\\nRecursos como la ironía o el sarcasmo logran que el discurso sea más *persuasivo* e impactante.\\n\\nCuando el orador usa ejemplos o analogías, su mensaje se vuelve más *atractivo* y fácil de comprender.\\n\\nUsar recursos retóricos en un discurso permite crear *imágenes* mentales que enriquecen el mensaje.\",\"distractors\":\"*hipérbole* *ideas* *explicación* *informativo*\"}","library":"H5P.DragText 1.10","contentUrl":".","metadata":{"license":"U","title":"Reconociendo el uso y efecto de los recursos retóricos","defaultLanguage":"en"},"scripts":["/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/jQuery.ui-1.10/h5p-jquery-ui.js?version=1.10.22","/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progress-circle.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-simple-rounded-button.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-speech-bubble.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-throbber.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-tip.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-slider.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-score-bar.js?version=1.3.19","/h5
